style.css:
@-moz-document domain("filelist.io") {
    body,  html {
      background: url('https://i.postimg.cc/htkGGdty/Pirate-Flag.jpg') no-repeat center center fixed;
      -webkit-background-size: cover;
      -moz-background-size: cover;
      -o-background-size: cover;
      background-size: cover;
   }
   .mainheader {
         width: 100%;
         height: 225px;
         background: url("https://i.postimg.cc/bwqGbJHP/Pirate-Flag-2.jpg") no-repeat;
         min-width: 1000px;
         background-position: center;
   }
   #navigation {
         top: 170px;
         width: 974px;
         height: 44px;
         margin: 0 5px;
         font-family: Helvetica,Arial,Verdana,sans-serif;
         position: absolute;
         background: rgba(0, 0, 0, 0.28);
         border: none;
         border-radius: 5px;
         box-shadow: rgba(0, 0, 0, 0.25) 0px 0px 2px;
         color: #fff;
         text-shadow: none;
   }
   #nav ul li, #nav ul li a {
         color: #FFFF00;
         text-decoration: none;
         font-weight: lighter;
         letter-spacing: 0.5px;
         text-shadow: none;
         transition: all 0.5s;
   }
   #nav ul li:hover, #nav ul li a:hover {
         color: #fff;
   }
   .statusbar {
         width: 425px;
         margin-top: 50px;
         padding: 5px 5px 5px 5px;
         color: #cbcbcb;
         float: right;
         font-size: 10px;
         background: rgba(0, 0, 0, 0.28);
         border: none;
         border-radius: 4px;
         text-align: center;
   }
   a {
         color: #8eaac1;
         transition: all 0.5s;
         text-shadow: #000 0px 0px 4px;
   }
   a { color: #FFFF00; transition: all 0.5s;}
         a:hover { color: #9ed0f9; }
         .visitedlinks a:visited {
         text-decoration: none;
         color: #10ace7;
    }
    .logo {
         position: relative;
         right: -50px;
         bottom: -40px;
         width: 410px;
         height: 100px;
         background: url('https://i.postimg.cc/26zrqFRw/File-List-Logo-2.png') no-repeat;
    }
    .globalFreeLeech {
         width: 60%;
         background: #1a2025;
         border: 1px solid #252d35;
         color: #E0E0E0;
         opacity: 0.9;
         margin: 0px auto;
         padding: 7px;
         font-weight: bold;
    }
    .cblock-content {
         width: 960px;
         padding: 10px;
         opacity: 0.9;
         background: #151e24;
         position: relative;
         border-radius: 10px;
    }
    .cblock-top {
         width: 977px;
         height: 0px;
         display: block;
         background: none;
    }
    input, select, .btn{
         background: #111619;
         border: none;
         color: #fff;
         box-shadow: none;
    }
    select option {
         color: #fff;
    }
    .pager a, .pager a:link {
         background: #111619;
         border: none;
         color: #fff;
    }
    .pager .current {
         margin: 0 2px;
         padding: 4px 6px;
         background: #202c33;
         border: none;
         font-weight: bold;
         font-size: 8pt;
         color: #FFFFFF;
         border-radius: 3px;
    }
    .colhead {
         font-weight: bold;
         color: #E0E0E0;
         background: #0b0e10;
         border: 1px solid #444;
         padding: 5px;
         opacity: 0.9;
    }
    .torrenttable {
         float: left;
         padding: 2px 0px;
         border: none;
         border-bottom: solid 1px rgba(253, 254, 255, 0.01);
    }
    .torrenttable img {
         border-radius: 9px;
    }
    ::-webkit-scrollbar {
         width: 1.4em;
    }
    ::-webkit-scrollbar-track {
         background: #FFDB58
    }
    ::-webkit-scrollbar-thumb {
         background: #151a1d;
    }
    .cblock-bottom {
         background: none;
    }
    #footer {
         background: url("https://s12.gifyu.com/images/SW26Q.jpg") no-repeat;
         padding-top: 35px;
         padding-bottom: 15px;
         width: 100%;
         height: 110px;
         bottom: 55px;
         position: absolute;
         min-width: 1050px;
    }
    #footerInner h2 {
         padding-bottom: 4px;
         margin-bottom: 14px;
         color: #36576d;
         font-size: 15px;
         border-bottom: 1px solid rgba(255, 255, 255, 0.02);
         font-family: Arial;
    }
    #copyright {
         border-top: none;
         width: 100%;
         height: 55px; background: #111619; 
         bottom: 0;
         position: absolute;
         min-width: 1050px;
    }
         fieldset {
         padding: 1em;
         border: 1px solid #13181b;
         background: #111619;
    }
    .cblock-header {
         width: 965px;
         height: 30px;
         float: left;
         background: #1a2025;
         position: relative;
    }
    .cblock-headerleft {
         width: 6px;
         height: 30px;
         display: block;
         float: left;
         background: #1a2025;
    }
    .cblock-headerright {
         width: 6px;
         height: 30px;
         display: block;
         float: left;
         background: #1a2025;
    }
    legend {
         padding: 2px 4px;
         background: #1d2529;
         color: #FFFFFF;
    }
    textarea {
         background: #111619;
         border: none;
         color: #fff;
    }
    .lbtn {
         background: #0b0e10;
         height: 20px;
         padding: 2px 0px 4px 0px;
         font-size: 12px;
         border: none;
         cursor: pointer;
         color: #fff;
    }
    .nblock-content {
         width: 684px;
         height: 100%;
         opacity: 0.9;
         padding: 20px 0 10px 0;
         background: #1a2025;
         position: relative;
    }
    .nblock-header {
         width: 671px;
         height: 30px;
         float: left;
         opacity: 0.9;
         background: #2a353e;
         position: relative;
    }
     .nblock-headerright {
         width: 6px;
         height: 30px;
         display: block;
         float: left;
         background: #2a353e;
    }
    .nblock-headerleft {
         width: 6px;
         height: 30px;
         display: block;
         float: left;
         background: #2a353e;
    }
    .nblock-innercontent {
         position: relative;
         bottom: 2px;
         top: -8px;
    }
    .sblock-header {
         width: 267px;
         height: 30px;
         float: left;
         opacity: 0.9;
         background: #2a353e;
         position: relative;
    }
    .sblock-headerleft {
         width: 6px;
         height: 30px;
         display: block;
         float: left;
         background: #2a353e;
    }
    .sblock-headerright {
         width: 6px;
         height: 30px;
         display: block;
         float: left;
         background: #2a353e;
    }
    .sblock-content {
         width: 280px;
         height: 100%;
         opacity: 0.9;
         padding: 20px 0 10px 0;
         background: #151a1d;
         position: relative;
    }
    #poll_separator {
         margin-top: 5px;
         padding-top: 5px;
         border-top: 1px solid rgba(237, 248, 255, 0.01);
    }
    .sblock-bottom {
         width: 279px;
         height: 6px;
         display: block;
         background: #161c1f;
         margin-bottom: 20px;
    }
    td.colhead {
         font-weight: bold;
         color: #E0E0E0;
         background: #0b0e10;
         padding: 5px;
    }
    #nav {
         height: auto;
         padding: 6px 20px;
         font-size: 13px;
         font-weight: bold;
         justify-content: center;
         align-items: center;
         display: flex;
    }
    td {
         font-size: 8pt;
         border: 1px solid #444;
         color: #E0E0E0;
    }
         .main, .mainouter {
         width: 912px;

         background-color: #101315;
         /* padding: 15px !important; */
    }
    .status_avatar {
         margin: 10px 41px 6px 12px;
         border: 1px solid;
         border-color: white;
         width: 55px;
         height: 65px;
    }
   #wrapper {
         height: 100%;
         min-height: 100%;
         position: relative;
         color: #cbcbcb;
    }
     .barmax {
         border: 1px solid #2298cb;
         background: #10ace7;
    }
     .bar {
         border: 1px solid #1f1f1f;
         background: #6a6161;
    }
    #copyrightInner {
         width: 970px;
         margin: 0 auto;
         font-size: 11px;
         color: #515151;
         padding: 13px 0;
         position: relative;
    }
    .spoiler {
         background: #454545;
         padding: 5px;
         border: 1px solid #5f5f5f;
         max-width: 702px;
         word-wrap: break-word;
    }
    .separator {
         border: 0;
         height: 3px;
         width: 600px;
         margin: 11px auto 0px auto;
         background-image: -webkit-linear-gradient(left, rgba(0,0,0,0), rgba(0,0,0,0.75), rgba(0,0,0,0));
    }
    #poll_separator {
          margin-top: 5px;
          padding-top: 5px;
          border-top: 1px solid #444;
    }
     .staffbox {
          width: 100px;
          border: 1px solid #cacaca;
          padding: 5px;
          margin: 0px 4px 10px 6px;
          background: #0b0e10;
          text-align: center;
    }
    .barmax {
          border: 1px solid #2298cb;
          background: #FFDB58;
    }
}
